    const keyP: uint8[] = [0x80, 0x40, 0x20, 0x10, 0x08, 0x04, 0x02, 0x01];

    const z: string = ""

    function encodeToGb2312(str: string) {
        let strOut = "";
        for (let i = 0; i < str.length; i++) {
            let c = str.charAt(i);
            let code = str.charCodeAt(i);
            if (c == " ") strOut += "+";
            else if (code >= 19968 && code <= 40869) {
                let index = code - 19968;
                strOut += "%" + z.substr(index * 4, 2) + "%" + z.substr(index * 4 + 2, 2);
            }
            else {
                strOut += "%" + z.substr(code * 4, 2) + "%" + z.substr(code * 4 + 2, 2);
            }
        }
        return strOut;
    }

    //% blockId="hetao_lcd_show_string" block="显示字符串 %str| 在 行%y| 列%x|"
    export function showString(str: string, y: number, x: number) {
        //带中文字符
        if (true) {
            let buf = Buffer.create(0)
            for (let i = 0; i < str.length; i++) {
                let offset = 0;
                if (str.charCodeAt(i) > 19968) {
                    let qq = encodeToGb2312(str[i])
                    let gbk = qq.split("%")
                    let qu = parseInt(gbk[1], 16) - 160 - 1
                    let ku = parseInt(gbk[2], 16) - 160 - 1
                    offset = (94 * qu + ku) * 32;
                }
                else {
                    offset = (188 + str.charCodeAt(i) - 33) * 32
                }
                let hh = hkz16.slice(offset, offset + 32)
                buf.concat(Buffer.fromArray(hh))
                for (let k = 0; k < 16; k++) {
                    let ps = ""
                    for (let j = 0; j < 2; j++) {
                        for (let m = 0; m < 8; m++) {
                            let flag = hh[k * 2 + j] & keyP[m];
                            if (flag) {
                                ps += "● "
                            }
                            else {
                                ps += "○ "
                            }
                        }
                    }
                    console.log(ps)
                }
                console.log("---------")
            }
            let addrBuf1 = Buffer.create(1)
            addrBuf1[0] = 64 + y * 16 + 0
            addrBuf1 = addrBuf1.concat(buf)
            pins.i2cWriteBuffer(9, addrBuf1)
        } else {
            let buf = Buffer.fromUTF8(str)
            let addrBuf = Buffer.create(1)
            addrBuf[0] = y * 16 + x
            pins.i2cWriteBuffer(9, addrBuf.concat(buf))
        }
    }

    //% blockId="hetao_lcd_show_number" block="显示数字 %num| 在 行%y| 列%x|"
    export function showNumber(num: number, y: number, x: number) {
        let str = convertToText(num)
        let buf = Buffer.fromUTF8(str)
        let addrBuf = Buffer.create(1)
        addrBuf[0] = y * 16 + x
        pins.i2cWriteBuffer(9, addrBuf.concat(buf))
    }

    //% blockId="hetao_lcd_clear" block="清空屏幕"
    export function clear() {
        let str = ""
        for (let i = 0; i < 64; i++) {
            str += " "
        }
        let buf = Buffer.fromUTF8(str)
        let addrBuf = Buffer.create(1)
        addrBuf[0] = 0
        pins.i2cWriteBuffer(9, addrBuf.concat(buf))
    }
